import React from "react";
import { Nav, Jumbotron } from "react-bootstrap";
import { GiModernCity } from "react-icons/gi";
const Splash = () => {
    return (
        <div className="container-splash">
            <Jumbotron className="jumbotron-nav">
                <Nav activeKey="/splah">
                    <Nav.Item>
                        <Nav.Link href="/splah">
                            <GiModernCity size="2rem" /> <span className="splash-span-name">Municipal Connect </span>
                        </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-1">Link</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2">Link</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="disabled" disabled>
                            Disabled
                        </Nav.Link>
                    </Nav.Item>
                </Nav>
            </Jumbotron>
        </div>
    );
};

export default Splash;
